import styled from 'styled-components';

export const Card = styled.div({
  boxShadow: '0 4px 8px 0 rgba(0, 0, 0, 0.2)',
  width: '100%',
  '& img': {
    objectFit: 'scale-down',
    top: 0,
    left: 0,
    transform: 'translate(-50px, -50px)'
  }
});
